import styled from "styled-components";


export const LoginFormWrapper = styled.form`
  margin-top: 5px;
  margin-left: 10px;
  padding-left: 10px;
  padding-right: 10px;
  padding-bottom: 10px;
  border: 1px solid skyblue;
  `
  
  export const LoginButtonWrapper = styled.div`
  margin-top: 10px;
  display:flex;
  justify-content:space-around;
`;
